import React from "react"

class Izvestaji extends React.Component{
    constructor(){
        super()
        this.state = {
            izvestaji:[],
            pocetakIzvestaja:"",
            krajIzvestaja:""
        }
    }

    render(){
        return(
            <div id="izvestaji">
                <input name="pocetak" placeholder="Pocetak izvestaja..." value={this.state.pocetakIzvestaja} />
            </div>
        )
    }
}

export default Izvestaji
